  adtargetsummarynotesjson:
    '[\n  {\n    "noteType": "targetSummaryMechanical",\n    "statement": "GFP also known as Green Fluorescent Protein acts as a bioluminescent marker derived from the jellyfish Aequorea victoria. GFP is popular in molecular biology for its fluorescence properties making it useful for visualizing proteins. This protein has a molecular weight of approximately 27 kDa. Researchers and scientists often express GFP in various organisms as a luminescent tag helping them observe protein expression localization and interaction within cells. GFP tagging involves the fusion of GFP to a protein of interest enabling the study of the protein\'s function and dynamics without affecting the host cell."\n  },\n  {\n    "noteType": "targetSummaryBiological",\n    "statement": "GFP serves as a marker due to its ability to emit green fluorescence without requiring additional substrates or cofactors. GFP does not function within complexes like other proteins but acts as a standalone tool to monitor physiological processes. Scientists utilize techniques such as Western blot ELISA and microscopy along with GFP to track and quantify proteins inside living cells. Anti-GFP antibodies can detect GFP fusion proteins in various applications providing valuable insights into protein behavior and allowing robust assays involving GFP."\n  },\n  {\n    "noteType": "pathway",\n    "statement": "GFP itself does not participate actively in traditional biochemical or signaling pathways. Instead it enables visual tracking within pathways. Researchers utilize GFP to study pathways like MAPK/ERK and PI3K/AKT where they track proteins related to these pathways using GFP tagging. For instance fusing GFP with proteins like ERK1/2 allows tracking phosphorylation events and signal transduction in living cells leading to better understanding of cellular responses to different stimuli."\n  },\n  {\n    "noteType": "disease",\n    "statement": "Researchers use GFP as a model to study gene expression and protein interactions under disease conditions. For example in neurological disorders GFP helps visualize neuronal pathways and protein aggregation processes. By tagging proteins such as amyloid precursor protein (APP) or tau with GFP scientists can study their role in Alzheimer\'s disease progression. Similarly GFP facilitates the investigation of cancer pathways allowing visualization of tumor-related proteins and helping researchers study how cancer cells grow and invade tissues supporting cancer research and therapy development."\n  }\n]',
