  reactivitytabledata:
    '[{"species": "Tag", "ICC/IF": {"reactivityType": "TESTED_AND_REACTS", "notes": "<p>We recommend Goat Anti-Rabbit IgG H&amp;L (Alexa Fluor<sup>\\u00ae</sup> 488) (ab150081) secondary antibody.</p>", "recommendeddilution": "1/200 - 1/1000", "suitability": "testedAndGuaranteed"}, "IP": {"reactivityType": "TESTED_AND_REACTS", "notes": "<p>Use at 1\\u00b5l per 10cm tissue culture dish (use 10\\u00b5l protein A agarose CL4B to precipitate the immune complex).</p>", "recommendeddilution": "", "suitability": "testedAndGuaranteed"}, "EM": {"reactivityType": "NO_EXPERIMENTAL_DATA_EXPECTED_TO_REACT", "notes": "<p></p>", "recommendeddilution": "", "suitability": "guaranteed"}, "ELISA": {"reactivityType": "NO_EXPERIMENTAL_DATA_EXPECTED_TO_REACT", "notes": "<p></p>", "recommendeddilution": "", "suitability": "guaranteed"}, "WB": {"reactivityType": "TESTED_AND_REACTS", "notes": "<p>It is recommended to use 12.5% SDS-PAGE and to transfer to PVDF membrane. Use 1x Blotto (or 3% BSA in PBS) for diluting and blocking. Use PBS in 3x 5min washing steps throughout the immunolabelling. Probe with ab290 at 1:1000 - 1:5000 dilution and use Goat Anti-Rabbit IgG H&amp;L (HRP) (ab205718) at 1:5000 dilution with ECL detection method. ab290 has been reported to work at 1:50,000 and dilutions around this range should be tested if high background is seen. Both incubation steps should be for 1hr at 22\\u00b0C.</p>", "recommendeddilution": "1/1000 - 1/2500", "suitability": "testedAndGuaranteed"}, "IHC-FoFr": {"reactivityType": "NO_EXPERIMENTAL_DATA_EXPECTED_TO_REACT", "notes": "<p></p>", "recommendeddilution": "", "suitability": "guaranteed"}, "IHC-P": {"reactivityType": "TESTED_AND_REACTS", "notes": "<p></p>", "recommendeddilution": "1/500 - 1/1000", "suitability": "testedAndGuaranteed"}, "IHC-Fr": {"reactivityType": "NO_EXPERIMENTAL_DATA_EXPECTED_TO_REACT", "notes": "<p>Reported to work at dilutions up to 1/3000. Use secondary antibody Goat Anti-Rabbit IgG H&amp;L (Alexa Fluor\\u00ae 488) (ab15077).</p>", "recommendeddilution": "", "suitability": "guaranteed"}, "IHC-FrFl": {"reactivityType": "TESTED_AND_REACTS", "notes": "<p></p>", "recommendeddilution": "1/1000", "suitability": "testedAndGuaranteed"}}]',
  adpurificationnotesjson:
    '[\n  {\n    "noteType": null,\n    "statement": "<div><p>This antibody is provided as whole antiserum. It is not possible to determine the exact concentration of the anti-GFP antibody ab290, since whole serum contains many other host serum proteins and other antibodies, besides the antibody of interest. The total IgG concentration is 5 mg/mL.</p><p>This antibody does not contain an anti-bacterial agent – use sterilized equipment and freeze small aliquots to reduce the risk of contamination.</p></div>"\n  }\n]',
