  adnotesjson:
    '[\n  {\n    "noteType": "generalpublicnotes",\n    "statement": "Anti-GFP antibody (ab290) is a chicken polyclonal antibody and is validated for use in ICC/IF and WB. <br><br>Anti-GFP antibody (ab290) was first used in a scientific publication in 2002 and has been cited over 3610 times in peer reviewed journals. It\'s performance in Western blot, immunofluorescence and IHC in human and mouse samples is trusted by the scientific community.<br><br>Abcam\'s high quality validation processes ensure Anti-GFP antibody (ab290) has high sensitivity and specificity.<br><br>Anti-GFP antibody (ab290) has 93 independent reviews from customers.<br><br>GFP antibodies are used to visualize proteins labelled with this tag in a variety of applications (for example imaging and Flow cytometry). To enable specific detection of your tagged protein, Anti-GFP antibody (ab290) has been validated in ICC/IF and WB. <br><br>Anti-GFP antibody (ab290) specifically detects GFP (UniProt ID: P42212; Molecular weight: 27kDa) and is sold in a convenient trial size to enable initial testing (50 &micro;L) and larger sizes for subsequent scaling up experiments (500 &micro;L).<br><br>Green Fluorescent Protein (GFP), originally derived from the jellyfish Aequorea victoria, emits a bright green fluorescence under ultraviolet or blue light. This unique property makes GFP an invaluable tool in molecular and cell biology research. Widely used to tag proteins, GFP allows scientists to visualize and track protein expression, localization and interactions within living cells. Key applications of GFP include fluorescence microscopy (ICC, IHC, IF), flow cytometry (FC) and western blotting (WB). <br><br>"\n  },\n  {\n    "noteType": "General Statements",\n    "statement": "<p>Abcam is leading the way to address reproducibility in scientific research with our highly validated recombinant monoclonal and recombinant multiclonal antibodies. Search & select one of Abcam\'s thousands of recombinant alternatives to eliminate batch-variability and unnecessary animal use.</p>\\n<p>If you do not find a host species to meet your needs, our catalogue and custom Chimeric range provides scientists the specificity of Abcam\'s RabMAbs in the species backbone of your choice. Remember to also review our range of edited cell lines, proteins and biochemicals relevant to your target that may help you further your research goals.</p>\\n<p>Abcam antibodies are extensively validated in a wide range of species and applications, so please check the reagent specifications meet your scientific needs before purchasing. If you have any questions or bespoke requirements, simply visit the Contact Us page to send us an inquiry or contact our Support Team ahead of purchase.</p>"\n  }\n]',
