  adtargetsummarynotesjson:
    '[\n  {\n    "noteType": "targetSummaryMechanical",\n    "statement": "NF-kB p65 also known as RelA is a significant component of the NF-kB protein complex. This complex usually involves a molecular weight for p65 of approximately 65 kDa. NF-kB p65 is mechanistically a transcription factor that regulates genes involved in inflammation cell survival and immune response. Expression of p65 is widely seen in various cell types including immune cells and epithelial cells suggesting its role in numerous physiological processes."\n  },\n  {\n    "noteType": "targetSummaryBiological",\n    "statement": "NF-kB p65 acts as part of the larger NF-kB complex usually forming a heterodimer with other family members like p50. This complex translocates to the nucleus upon activation where it binds specific DNA sequences to regulate gene expression. The p65 subunit is essential for transactivating target genes involved in immune and inflammatory responses. Its regulation is important for proper cellular functioning especially in the maintenance of immune homeostasis and inflammatory response."\n  },\n  {\n    "noteType": "pathway",\n    "statement": "NF-kB p65 participates in critical pathways like the NF-kB signaling and Toll-like receptor pathways. These pathways are fundamental for initiating immune responses and contribute to the regulation of apoptosis and cellular stress responses. In the context of these pathways the IKK complex plays a pivotal role in NF-kB activation leading to the phosphorylation and subsequent degradation of inhibitors that retain NF-kB p65 in the cytoplasm therefore allowing its movement to the nucleus."\n  },\n  {\n    "noteType": "disease",\n    "statement": "NF-kB p65 is implicated in conditions such as cancer and autoimmune diseases. Its dysregulation can lead to persistent activation of inflammatory pathways contributing to tumorigenesis and chronic inflammation. In the context of these diseases proteins such as the p50 subunit and the IKK complex are often involved reflecting the importance of tight regulation of NF-kB signaling in preventing pathological conditions."\n  }\n]',
