  aderpnumber: 'AB216880-abcam',
  adtargetsummarynotesjson:
    '[\n  {\n    "noteType": "targetSummaryMechanical",\n    "statement": "The ZO1 tight junction protein also known as TJP1 is a critical component of tight junctions in epithelial and endothelial cells. It is a 225 kDa protein that plays a mechanical role in stabilizing cell-cell junctions by linking the actin cytoskeleton to tight junction membrane proteins. ZO1 is expressed in various tissues including the liver kidney and brain where it is essential for maintaining cell polarity and permeability barriers. It acts as a scaffold facilitating the organization of other tight junction proteins."\n  },\n  {\n    "noteType": "targetSummaryBiological",\n    "statement": "ZO1 tight junction protein maintains cellular barriers and regulates paracellular permeability. This protein forms part of the tight junction complex with other proteins like occludin and claudins contributing to cellular integrity. ZO1\'s presence at tight junctions helps control the passage of ions and molecules between cells therefore ensuring selective permeability while protecting tissue function. Its ability to interact with multiple proteins enables it to coordinate complex signaling mechanisms that are important for cell adhesion and communication."\n  },\n  {\n    "noteType": "pathway",\n    "statement": "The tight junction protein ZO1 participates in important signaling pathways like the epithelial barrier formation pathway and the actin cytoskeleton regulation pathway. It interacts with proteins like ZO2 and ZO3 which are critical for enhancing barrier function and cytoskeletal dynamics. By participating in these pathways ZO1 helps mediate both the structural and signaling functions necessary for maintaining tissue homeostasis and responding to cellular stress or injury."\n  },\n  {\n    "noteType": "disease",\n    "statement": "ZO1 protein plays a role in conditions such as inflammatory bowel disease (IBD) and cancer. In IBD the disruption of ZO1 leads to compromised intestinal barriers contributing to disease pathogenesis. The loss or mislocalization of ZO1 has been associated with tumorigenesis in cancers where its interaction with other junctional proteins like claudins could influence cancer cell invasiveness. Understanding ZO1\'s involvement in these disorders provides insights into potential therapeutic targets for improving epithelial barrier function."\n  }\n]',
