  adnotes:
    'This Lyophilized Exosome Standard (100 μg, Human Plasma) ab288118 was previously known as ExoStd Lyophilized Exosome Standard (100 μg, Human Plasma) M1041. <p>These lyophilized exosome standards are standardized positive controls for immunocapture performance evaluation. Lyophilization is the ideal technique for preserving the long-term stability of exosomes at 4 °C. Lyophilized exosomes can be used as control standards for multiple applications including FACS, WB, ELISA and as calibration standards for quantitation of exosome-derived markers from biological samples. Lyophilized exosomes are easy to ship and store, and are stable for over 36 months at 4 °C. Purified and lyophilized exosomes are obtained from a variety of biological sources: cell culture supernatant, human plasma, serum, urine and saliva. Exosomes are purified following a combination of ultracentrifugation and microfiltration steps. Exosomes are subsequently quantified and validated for overall protein content and particle number by NTA (Nanoparticles Tracking Analysis) with NanoSight LM10. Lyophilization does not affect the stability of purified exosomes and the expression levels of their exosome markers (proteins and nucleic acids). These lyophilized exosome standards are highly pure, easy to reconstitute and easy to ship and store at 4°C.</p>',
