    "Reconstitute in deionized water: 100 µl for a 100 µg lyophilized standard to achieve 1 µg/µl. Suspend exosomes by pipetting up and down 10-15 times avoiding bubbles. Vortex the solution for 60 seconds. Briefly centrifuge to collect the solution at the tube's bottom. Pipette up and down 10 times avoiding bubbles. After reconstitution store at -20°C for up to 1 month or at -80°C for up to 6 months. Avoid repeated freeze-thaw cycles.",
