    "adnotes": "<p>Corticosterone ELISA kit ab108821 is a competitive ELISA kit to measure quantify corticosterone (CORT) in serum, plasma, saliva, urine, and milk with a sensitivity of 0.28 ng/mL.</p><p><strong>How the assay works</strong></p><p>Corticosterone ELISA kit ab108821 is a competitive ELISA. There are 2 types of competitive ELISAs:</p><ul>  <li><strong>antigen down</strong>: The sample antigen competes with a reference antigen for binding to a specific amount of labeled antibody. The reference antigen is pre-coated on a multi-well plate. The sample is added to the plate wells with a labeled antibody. Depending on the amount of antigen in the sample, more or fewer free antibodies will be available to bind the reference antigen. This means that the more of the antigen there is in the sample, the less reference antigen will be detected and the weaker the signal will be.</li>  <li><strong>antibody down</strong>: the labeled antigen and the sample antigen (unlabeled) compete for binding to the primary antibody, which is immobilized on the plate. The lower the amount of antigen in the sample, the stronger the signal due to more labelled antigen in the well.</li></ul><p><strong>Assay specificity</strong></p><p>Our ELISA kits are rigorously validated to ensure the highest level of consistency and reproducibility.</p><p><strong>Corticosterone ELISA kit ab108821 protocol summary</strong></p><ol>1. A Corticosterone specific antibody has been precoated onto 96-well plates and blocked. This plate is provided in the kit. <br>2. Standards or test samples are added to the wells of the plate, and subsequently biotinylated Corticosterone is added. <br>3. The plates are then washed with wash buffer. <br>4. Avidin-Biotin-Peroxidase Complex is added and unbound conjugates are washed away with wash buffer. <br>5. TMB is then added to the plate. TMB is catalyzed by HRP to produce a blue color product that changes into yellow after adding acidic stop solution. The density of yellow coloration is inversely proportional to the amount of Corticosterone captured in the plate, and to the Corticosterone levels in the samples.</ol>",
