    "adbiochemicalattributesjson": "{\n  \"biologicalAction\": [\n    \"Other\"\n  ],\n  \"biologicalDescription\": \"Potent endogenous glucocorticoid and mineralocorticoid receptor agonist (EC<sub>50</sub> = 20 nM, GR). Induces apoptosis. Modulates carbohydrate, potassium, and sodium metabolism <em>in vivo</em>. Blood-brain barrier permeable.\",\n  \"biochemicalName\": \"Corticosterone\",\n  \"canonicalSmiles\": \"CC12CCC(=O)C=C1CCC3C2C(CC4(C3CCC4C(=O)CO)C)O\",\n  \"casNumber\": \"50-22-6\",\n  \"cellPermeable\": false,\n  \"chemicalStructureImage\": \"https://pubchem.ncbi.nlm.nih.gov/image/imgsrv.fcgi?cid=5753&t=s\",\n  \"chemicalType\": [\n    \"Biochemical\"\n  ],\n  \"emission\": null,\n  \"excitation\": null,\n  \"expectedPurity\": \"\",\n  \"inchi\": {\n    \"key\": \"OMFXVFTZEKFJBZ-HJTSIMOOSA-N\",\n    \"value\": \"InChI=1S/C21H30O4/c1-20-8-7-13(23)9-12(20)3-4-14-15-5-6-16(18(25)11-22)21(15,2)10-17(24)19(14)20/h9,14-17,19,22,24H,3-8,10-11H2,1-2H3/t14-,15-,16+,17-,19+,20-,21-/m0/s1\"\n  },\n  \"isomericSmiles\": \"C[C@]12CCC(=O)C=C1CC[C@@H]3[C@@H]2[C@H](C[C@]4([C@H]3CC[C@@H]4C(=O)CO)C)O\",\n  \"iupacName\": \"(8S,9S,10R,11S,13S,14S,17S)-11-hydroxy-17-(2-hydroxyacetyl)-10,13-dimethyl-1,2,6,7,8,9,11,12,14,15,16,17-dodecahydrocyclopenta[a]phenanthren-3-one\",\n  \"molecularFormula\": \"C21H30O4\",\n  \"molecularWeight\": \"346.5 Da\",\n  \"nature\": \"\",\n  \"pubChemId\": \"5753\",\n  \"solubility\": [\n    \"Soluble in DMSO to 100 mM\",\n    \"Soluble in ethanol to 10 mM\"\n  ],\n  \"source\": \"\"\n}",
